/*!40000 ALTER TABLE `policy` DISABLE KEYS */;
INSERT INTO `policy` VALUES (1,'<p>At GoldenB, we strive to ensure that you are fully satisfied with your purchase. Our exchange and return policy is designed to be transparent and fair, reflecting our commitment to providing high-quality service and products.</p><h4><strong>Eligibility for Exchange and Return</strong></h4><p><strong>Time Frame</strong>:</p><ul><li class=\"ql-indent-1\">Items must be returned or exchanged within 30 days of the original purchase date.</li></ul><p><strong>Condition</strong>:</p><ul><li class=\"ql-indent-1\">Items must be in their original, unused condition, with all tags attached and accompanied by the original sales receipt.</li><li class=\"ql-indent-1\">Items showing signs of wear, alteration, or damage will not be accepted.</li></ul><p><strong>Non-Returnable Items</strong>:</p><ul><li class=\"ql-indent-1\">Custom-made jewelry, engraved items, and items marked as final sale are not eligible for returns or exchanges.</li><li class=\"ql-indent-1\">Gift cards and jewelry care products are non-refundable.</li></ul><h4><strong>Exchange Policy</strong></h4><p><strong>In-Store Exchange</strong>:</p><ul><li class=\"ql-indent-1\">Bring the item(s) to any GoldenB store location.</li><li class=\"ql-indent-1\">Our staff will assist you in selecting an exchange item of equal or greater value.</li><li class=\"ql-indent-1\">If the new item is of greater value, you will be responsible for paying the difference.</li><li class=\"ql-indent-1\">If the new item is of lesser value, the difference will be issued as a store credit.</li></ul><p><strong>Mail-In Exchange</strong>:</p><ul><li class=\"ql-indent-1\">Contact our customer service to initiate an exchange and receive a return authorization number.</li><li class=\"ql-indent-1\">Securely package the item(s) with the return authorization number and the original receipt.</li><li class=\"ql-indent-1\">Ship the package to the address provided by our customer service team.</li><li class=\"ql-indent-1\">Upon receipt and inspection of the returned item(s), we will process the exchange and ship the new item to you.</li></ul><h4>Return Policy</h4><p><strong>In-Store Return</strong>:</p><ul><li class=\"ql-indent-1\">Bring the item(s) to any GoldenB store location.</li><li class=\"ql-indent-1\">Our staff will inspect the item(s) and process your return.</li><li class=\"ql-indent-1\">Refunds will be issued in the original form of payment.</li><li class=\"ql-indent-1\">Please allow up to 7 business days for the refund to reflect in your account.</li></ul><p><strong>Mail-In Return</strong>:</p><ul><li class=\"ql-indent-1\">Contact our customer service to initiate a return and receive a return authorization number.</li><li class=\"ql-indent-1\">Securely package the item(s) with the return authorization number and the original receipt.</li><li class=\"ql-indent-1\">Ship the package to the address provided by our customer service team.</li><li class=\"ql-indent-1\">Upon receipt and inspection of the returned item(s), we will process your refund.</li><li class=\"ql-indent-1\">Please allow up to 7 business days for the refund to reflect in your account.</li></ul><h4>Important Notes</h4><ul><li>Shipping and handling charges are non-refundable.</li><li>GoldenB is not responsible for lost or damaged packages during the return shipment.</li><li>We recommend using a trackable shipping method and purchasing shipping insurance for items of high value.</li></ul>','Exchange and Return GoldenB Jewelry Policy','EXCHANGE_AND_RETURN'),(2,'<p>At GoldenB, we take pride in the quality and craftsmanship of our jewelry. Our warranty policy ensures that you can enjoy your purchase with peace of mind.</p><h4>Warranty Coverage</h4><ul><li>All jewelry pieces are covered by a 1-year warranty from the date of purchase.</li><li>The warranty covers manufacturing defects in materials and workmanship.</li><li>The warranty does not cover damage caused by accidents, misuse, or normal wear and tear.</li></ul><h4>Warranty Services</h4><p><strong>Repair Services</strong></p><ul><li>If your jewelry piece has a manufacturing defect, we will repair it free of charge within the warranty period.</li><li>For repairs outside the warranty period, a fee will be charged based on the extent of the repair needed.</li><li>All repairs must be handled by GoldenB to ensure the integrity of the jewelry piece.</li></ul><p><strong>Replacement Services</strong></p><ul><li>If the jewelry piece cannot be repaired due to a manufacturing defect, we will replace it with an identical piece.</li><li>If an identical piece is not available, you can choose a replacement of equal or lesser value.</li><li>If the replacement is of greater value, you will be responsible for paying the difference.</li></ul><h4>Warranty Claims Process</h4><ul><li>Contact our customer service team to initiate a warranty claim.</li><li>Provide proof of purchase and a description of the issue.</li><li>Our customer service team will provide instructions for sending the jewelry piece to us.</li><li>Once received, our experts will inspect the piece and determine the appropriate action (repair or replacement).</li><li>We will notify you of the inspection results and the next steps within 7 business days of receiving the piece.</li></ul><h4>Important Notes</h4><ul><li>The warranty is void if the jewelry piece has been altered or repaired by anyone other than GoldenB.</li><li>The warranty is non-transferable and only applies to the original purchaser.</li><li>Shipping costs for warranty claims are the responsibility of the customer.</li><li>We recommend using a trackable shipping method and purchasing shipping insurance for high-value items.</li></ul>','GoldenB Jewelry Warranty Policy','WARRANTY'),(3,'Our policy lasts 30 days. If 30 days have gone by since your purchase, unfortunately we canÃÂ¢ÃÂÃÂt offer you a refund or exchange.','Returns','EXCHANGE_AND_RETURN'),(4,'Once your return is received and inspected, we will send you an email to notify you that we have received your returned item. We will also notify you of the approval or rejection of your refund.','Refunds','EXCHANGE_AND_RETURN'),(5,'<p>If you haven\'t received a refund yet, first check your bank account again. Then contact your credit card company, it may take some time before your refund is officially posted. Next contact your bank. There is often some processing time before a refund is posted. If youÃÂ¢ÃÂÃÂve done all of this and you still have not received your refund yet, please contact us at anltse173297@fpt.edu.vn</p>','Late or missing refunds\n','EXCHANGE_AND_RETURN'),(6,'<p>GoldenB Jewelry (\"the Company\") provides a Limited Warranty covering defects in materials and workmanship for jewelry items purchased directly from the Company.</p>','Warranty Coverage','WARRANTY'),(7,'Each jewelry item purchased from the Company is covered under warranty for a period of 30 days from the date of receipt goods.','Warranty Duration','WARRANTY'),(8,'<p>The Limited Warranty does not cover: </p><ol><li>Jewelry items purchased from unauthorized retailers or individuals. </li><li>Normal wear and tear, including scratches, dents, and faded colors.</li><li> Damage caused by misuse, neglect, accidents, or any external causes. </li><li>Damage caused by unauthorized modifications, repairs, or alterations. </li><li>Loss or theft.</li><li>Direct or consequential damages to persons or property.</li></ol>','Exclusions','WARRANTY'),(9,'<p>To make a warranty claim:</p><ol><li>Provide a valid proof of date of receipt of product within the warranty period.</li><li>Send a clear photograph of the defective item, along with a detailed description of the defect.</li><li>Send the aforementioned details via email to anltse173297@fpt.edu.vn.</li><li>Wait for confirmation and further instructions from our Customer Service department.</li><li>If replacement product is needed quickly, another order can be placed while the warranty claim is processed.</li></ol>','Warranty Claim Process','WARRANTY');
/*!40000 ALTER TABLE `policy` ENABLE KEYS */;
UNLOCK TABLES;

